import react from 'react';
import './style.scss'

const Button = ({ buttonName , buttonClassName, begin}: any) => {
  return (
    <button className={`${buttonClassName}-button ${buttonClassName}-button--${buttonName} `} name={buttonName} onClick={() => buttonName()}>
      {buttonName} 
    </button>
  )
}
export default Button;
